import { useState } from "react";
import "./App.css";

const App = () => {
  const [counter, setCounter] = useState(0);

  function decrement() {
    setCounter(counter - 1);
  }

  function increment() {
    setCounter(counter + 1);
  }

  return (
    <div className="App">
      <button onClick={setCounter}>-</button>
      <h1>{counter}</h1>
      <button onClick={increment}>+</button>
    </div>
  );
};

export default App;
